import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';

let rerenderEntireTree = (state) => {
    ReactDOM.render(<App state={state}/>, document.getElementById('root'));
};

export default rerenderEntireTree;
